  constructor(props)
  {
    super(props);

    console.log(this.props.sections);
  }



  render()
  {
    return (
      <MapInteractionCSS defaultValue={{scale: 0.25,translation : {x : 50,y: 250}}} >
          <CardVSM sections={this.props.sections} productionId={this.props.productionId}/>
      </MapInteractionCSS>
    );
  }
}
